import  React, {Component} from "react";


class Home extends Component {

    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="container">
                <h1>
                    Hello {this.props.username}!
                </h1>
            </div>
        );
    }
}

export default Home;
